import React, { useState, useEffect } from 'react';
import { useParams, Link } from 'react-router-dom';
import './PatientDetail.css';

const PatientDetail = () => {
  const [thingspeakData, setThingspeakData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const CHANNEL_ID = "2895763";
        const READ_API_KEY = "MWFBV98HOZOHTHY4";

        const response = await fetch(
          `https://api.thingspeak.com/channels/${CHANNEL_ID}/feeds.json?api_key=${READ_API_KEY}&results=1`
        );

        if (!response.ok) {
          throw new Error('Failed to fetch ThingSpeak data');
        }

        const data = await response.json();

        if (data.feeds && data.feeds.length > 0) {
          const latestData = data.feeds[0];
          // Convert the ThingSpeak data into a more readable format
          const formattedData = {
            name: "Patient Name", // You can set a default name or remove if not needed
            phone_number: "123-456-7890", // You can set a default phone or remove if not needed
            patient_id: CHANNEL_ID,
            age: "N/A", // You can set a default age or remove if not needed
            sensorData: {
              field1: latestData.field1,
              field2: latestData.field2,
              field3: latestData.field3,
              field4: latestData.field4,
              lastUpdate: new Date(latestData.created_at).toLocaleString()
            }
          };
          setThingspeakData(formattedData);
        } else {
          throw new Error('No data available from ThingSpeak');
        }

        setLoading(false);
      } catch (err) {
        setError(err.message);
        setLoading(false);
      }
    };

    fetchData();

    // Set up polling every 30 seconds
    const interval = setInterval(fetchData, 30000);

    return () => clearInterval(interval);
  }, []);

  if (loading) {
    return <div className="loading">Loading patient data...</div>;
  }

  if (error) {
    return <div className="error">Error: {error}</div>;
  }

  if (!thingspeakData) {
    return <div className="error">No data available</div>;
  }

  return (
    <div className="patient-detail-container">
      <div className="patient-detail-header">
        <Link to="/" className="back-button">← Back to Dashboard</Link>
        <h2>Patient Details</h2>
      </div>

      <div className="patient-info-section">
        <div className="patient-profile">
          <h3>Patient Information</h3>
          <div className="info-grid">
            <div className="info-item">
              <span className="label">Name:</span>
              <span className="value">{thingspeakData.name}</span>
            </div>
            <div className="info-item">
              <span className="label">Phone Number:</span>
              <span className="value">{thingspeakData.phone_number}</span>
            </div>
            <div className="info-item">
              <span className="label">Patient ID:</span>
              <span className="value">{thingspeakData.patient_id}</span>
            </div>
            <div className="info-item">
              <span className="label">Age:</span>
              <span className="value">{thingspeakData.age}</span>
            </div>
          </div>
        </div>

        <div className="thingspeak-data">
          <h3>Sensor Readings</h3>
          <div className="info-grid">
            <div className="info-item">
              <span className="label">Temperature:</span>
              <span className="value">{thingspeakData.sensorData.field1} °C</span>
            </div>
            <div className="info-item">
              <span className="label">Heart Rate:</span>
              <span className="value">{thingspeakData.sensorData.field2} BPM</span>
            </div>
            <div className="info-item">
              <span className="label">SpO2:</span>
              <span className="value">{thingspeakData.sensorData.field3} %</span>
            </div>
            <div className="info-item">
              <span className="label">ECG:</span>
              <span className="value">{thingspeakData.sensorData.field4}</span>
            </div>
            <div className="info-item">
              <span className="label">Last Updated:</span>
              <span className="value">{thingspeakData.sensorData.lastUpdate}</span>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default PatientDetail;
